precis:
REGULATIONS AMENDING CERTAIN REGULATIONS MADE UNDER THE PROCEEDS OF CRIME (MONEY LAUNDERING) AND TERRORIST FINANCING ACT (2008-2) which amend the following Regulations:

(1) Proceeds of Crime (Money Laundering) and Terrorist Financing Suspicious Transaction Reporting Regulations; 
(2) Proceeds of Crime (Money Laundering) and Terrorist Financing Regulations;
and, 
(3) Proceeds of Crime (Money Laundering) and Terrorist Financing Registration Regulations.
